  \"valley-city-wetland-management-district-annual-narrative-report-fiscal-year-1975\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Valley City Wetland
  Management District during the 1975 fiscal year. The report begins by giving a description
  of the area, status of the acquisition program, and habitat conditions during the
  year. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, raptors, rare and endangered species, fish, and
  disease- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, cultivated crops, and vegetation control. Resource
  management is described; topics include grazing, haying, and fur harvest. A progress
  report on field investigations and applied research is also provided. The public
  relations section discusses recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
